import React, {Component} from 'react'
import {Button, Toast} from "antd-mobile";

export default class App extends Component {
    handleClick = () =>{
        Toast.info('提交成功')
    }

    render() {
        return (
            <div>
                <Button type="primary" onClick={this.handleClick}>start</Button>
            </div>
        )
    }
}
